■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>よころびの花の「ばら」がモチーフ。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5075/8389bg-01.jpg" width="318" height="500"><br><font size=3></font></div><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">マットな銀色のシール地に清楚でエレガントなバラ柄を、輝きのある銀色の箔押し加工でデザインしたプリマージュ「ばら」シリーズの封緘用シールです。</font></td></tr></table><br><!--ab--><!--ab2015.6--><br>【必ずご確認ください】<br>※この商品はメーカーより直送のため、他の商品との同梱はできません<br> ※離島の場合、別途中継料がかかります。<br>※代引でのお支払いはお受けできません。 <br>※お届け先が沖縄・北海道・離島の場合、通常納期より3～6日ほど日数が掛かる場合がございます。■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">マットな銀色のシール地に清楚でエレガントなバラ柄を、輝きのある銀色の箔押し加工でデザインしたプリマージュ「ばら」シリーズの封緘用シールです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：9×15×2cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：100g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">紙</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="